import React from 'react';
import { Link } from 'react-router-dom';
import './canvas.css';

export default function Navbar() {
  return (
  <>
    <ul>
        <Link to="/portfolio" className='portfolio'>Check out my projects here!</Link>
    </ul>
  </>
  );
};
